Discover three unique coffee spots in Midtown Manhattan, each offering a distinct experience:

@arabicausa (37 W 54th St) 
Minimalist Kyoto vibes with expertly crafted lattes. Try their signature Kyoto Latte!

@ciniconyc (199 Madison Ave) 
Italian luxury meets NYC energy. Enjoy rich espresso, focaccia, and fine wines.

@intimissimi  by @dellaria_coffee Café (601 5th Ave) – Chic Italian elegance with premium coffee in a stylish setting. Perfect for a luxe break!

Which one are you trying first?
